import React, { useEffect } from "react";
import { useGoogleLogin } from "@react-oauth/google";
import "./WelcomePage.css";
function WelcomePage({ onLogin, onSignup, errorMessage, clearError }) {
    const login = useGoogleLogin({
        onSuccess: (credentialResponse) => {
          console.log("Login Credential Response:", credentialResponse);
          onLogin(credentialResponse, false); // Pass to handleLoginSuccess
        },
        onError: (error) => {
          console.error("Login failed:", error);
          setErrorMessage("Login failed. Please try again.");
        },
        scope: "openid email profile", // Ensure proper scopes
      });

      const signup = useGoogleLogin({
        onSuccess: (credentialResponse) => {
          console.log("Signup Credential Response:", credentialResponse);
          onSignup(credentialResponse, true); // Pass to handleLoginSuccess
        },
        onError: (error) => {
          console.error("Signup failed:", error);
          setErrorMessage("Signup failed. Please try again.");
        },
        scope: "openid email profile", // Ensure proper scopes
      });


  return (
    <div className="welcome-page">
      <h1>Welcome to TooturAI</h1>
      <p>Please log in or sign up to get started!</p>
      {errorMessage && <p className="error-message">{errorMessage}</p>}
      <div className="buttons">
        <button onClick={login}>Login</button>
        <button onClick={signup}>Sign Up</button>
      </div>
    </div>
  );
}

export default WelcomePage;
